  constructor(props){
    super(props)

    this.state = {
      clubs : []
    }
  }

  componentWillMount() {

    var self = this;
    axios.get('http://localhost:8080/clubs')
        .then(function (response) {
          var clubs = response.data;
          self.setState({clubs})
        })
        .catch(function (error) {
          console.log(error);
